import React from "react";
import "./App.css";
import DivBlock from "./componets/DivBlock";

class App extends React.Component {
  state = {
    blocks: [
      {
        row: [15, 2, 1, 12],
      },
      {
        row: [8, 5, 6, 11],
      },
      {
        row: [4, 9, 10, 7],
      },
      {
        row: [3, 14, 13, null],
      },
    ],
    nullTracker: 15,
  };

  render() {
    return (
      <div>
        <DivBlock blocks={this.state.blocks} />
      </div>
    );
  }
}

export default App;
